// Komponen ikon SVG untuk digunakan di MovieDetailInfo
const IconInfo = ({ icon, text, link = null }) => (
    <div className="text-base text-gray-300 mb-2 leading-relaxed flex items-center">
        <span className="mr-2 text-blue-400">{icon}</span>
        <div>
            <strong>{text}</strong>
            {link ? (
                <a href={link} target="_blank" rel="noopener noreferrer" className="text-blue-400 hover:underline">
                    {link}
                </a>
            ) : (
                <span className="ml-1"></span>
            )}
        </div>
    </div>
);

